import time
from typing import List, Dict


class Solution:

    def findSubstring(self, s: str, words: List[str]) -> List[int]:
        token_len = len(words[0])
        pattern_len = len(words) * token_len
        if pattern_len > len(s):
            return []
        solutions = []

        # dict of words keep number of tokens of each kind required
        words_dict = dict()
        for word in words:
            if word not in words_dict:
                words_dict[word] = 1
            else:
                words_dict[word] += 1

        # locations map keeps indexes of tokens found in current window
        word_locations = self.createWordLocationMap(s[:pattern_len], words)
        last_token_location_in_pattern = pattern_len - token_len
        for i in range(len(s) - pattern_len + 1):

            if i > 0:
                # after taking each step other than the first decrease
                # all word ix-s by 1 (since we just moved the window by 1)
                # if something slides out of window remove it
                self.decrease_and_remove_word_indexes(word_locations)

                # check last token in window, if it's a token add it
                last_token_in_window_start_ix = i + pattern_len - token_len
                last_token_in_window_end_ix = i + pattern_len - 1
                word_candidate = s[last_token_in_window_start_ix:last_token_in_window_end_ix + 1]

                # last_token_location_in_pattern which should be equal to last_token_in_window_start_ix - i
                # is the index of the word candidate in the window
                if word_candidate in words_dict:
                    if word_candidate not in word_locations:
                        word_locations[word_candidate] = [last_token_location_in_pattern]
                    else:
                        word_locations[word_candidate].append(last_token_location_in_pattern)

            # check if we have a solution
            # need to exclude all indexes which are NOT the multiple of token_len to exclude overlapping ones
            if self.locations_map_has_all_tokens(word_locations, words_dict, token_len):
                solutions.append(i)

        return solutions

    def decrease_and_remove_word_indexes(self, word_locations):
        for word in word_locations:
            word_locations[word] = [loc - 1 for loc in word_locations[word] if loc > 0]

    def locations_map_has_all_tokens(self, word_locations: Dict, words_dict: Dict, token_len):
        word_locations_current = dict(word_locations)
        for word in word_locations_current:
            word_locations_current[word] = [w for w in word_locations_current[word] if w % token_len == 0]

        for word in words_dict:
            if word not in word_locations_current or len(word_locations_current[word]) < words_dict[word]:
                return False
        return True

    # {'ab': [0, 6]}
    def createWordLocationMap(self, s: str, words: List[str]) -> Dict:
        words_set = set(words)
        word_locations = dict()

        token_len = len(words[0])
        for i in range(len(s) - token_len + 1):
            word = s[i:i + token_len]
            if word in words_set:
                if word not in word_locations:
                    word_locations[word] = [i]
                else:
                    word_locations[word].append(i)

        return word_locations

    def findSubstringBrute(self, s: str, words: List[str]) -> List[int]:
        trie = self.Trie()
        trie.insert_all(words)

        # blueprint immutable words dict
        words_dict = dict()
        for word in words:
            if word not in words_dict:
                words_dict[word] = 1
            else:
                words_dict[word] += 1

        words_to_be_found = dict(words_dict)
        root_ix = 0
        ix = 0
        solutions = []
        prefix_acc = ""

        while ix < len(s):
            reset = False
            word_candidate = prefix_acc + s[ix]
            if not trie.any_starts_with(word_candidate):
                reset = True
            elif trie.contains(word_candidate):
                if words_to_be_found[word_candidate] == 0:
                    reset = True
                elif self.has_this_last_word(words_to_be_found, word_candidate):
                    solutions.append(root_ix)
                    root_ix += 1
                    ix = root_ix
                    words_to_be_found = dict(words_dict)
                    prefix_acc = ""
                else:
                    words_to_be_found[word_candidate] -= 1
                    prefix_acc = ""
                    ix += 1
            else:
                prefix_acc += s[ix]
                ix += 1

            if reset:
                root_ix += 1
                ix = root_ix
                words_to_be_found = dict(words_dict)
                prefix_acc = ""

        return solutions

    def has_this_last_word(self, words_dict: dict[str, int], word_candidate: str):
        return words_dict[word_candidate] == 1 and sum(words_dict.values()) == 1

    class Trie:
        def __init__(self):
            self.node = {}

        def insert_all(self, words: List[str]):
            for word in words:
                self.insert(word)

        def insert(self, word: str):
            current_node = self.node
            for c in word:
                if c not in current_node:
                    current_node[c] = {}
                current_node = current_node[c]
            current_node["is_real_word"] = True

        def contains(self, word):
            current_node = self.node
            for c in word:
                if c not in current_node:
                    return False
                current_node = current_node[c]
            return "is_real_word" in current_node

        def any_starts_with(self, prefix):
            current_node = self.node
            for c in prefix:
                if c not in current_node:
                    return False
                current_node = current_node[c]
            return True


